css:
@-moz-document domain("1.1.1.1") {
body{
  font-family:Helvetica;
 background:#EFEFEF  url("data:image/jpeg;base64,") !important;
}

#formId{
  width:340px !important;
  /*height:300px !important;*/
  margin:15% auto;
  /*border:1px solid #ccc;*/
  /*border-radius:8px;*/
  box-shadow:0 0 10px 0 rgba(0,0,0,.1);
  background-color:#fff;
}

#formId > table > tbody > tr:first-child{
    border:1px solid #356e8b;
}
#formId > table > tbody > tr:first-child >td{
   border-radius:0 0 0 0;
    background:none;
    background-color:#356e8b;
    border:1px solid #356e8b;
}

#formId > table > tbody > tr >td+td{
 border-radius:0 6px 0 0;
}

#formId > table > tbody > tr >td h1{
	display:none;
}

#formId table tbody td div.content{
  position:static;
  width:320px !important;
  margin-left:0px;
  margin-top:0;
  margin-right:-100px;
}

.message[width="400"]{
  	display:none;
  }


#formId input[name='username'],
#formId input[name='password']{
  	font-size:1.75em !important;
  width:180px;
  height:1.5em;
  padding:0.25em;
  border-radius:4px;
  border:0.075rem solid #999;
   background-color:#eee;
}

#formId input[name='username']:hover,
#formId input[name='password']:hover{
   background-color:Highlight;
}

#formId input[name='Submit']{
    	font-size:1.5em !important;
  padding:0.75em 2em;
    width:160px;
display:block;
	    border-radius:4px;
  margin-left:-40px;
  background-color:#5792b0;
  box-shadow:0 2px 0 0 #25546b;
    border:none;
}


#formId div table table td[nowrap]{
   font-size:1em !important;
}

body > div[align='center'],
body > form > div[align='center']{
    width:340px !important;
  height:auto !important;
  margin:15% auto;
  border:1px solid #ccc;
  border-radius:8px;
  box-shadow:2px 4px 4px rgb(0,200,200,50);
  background-color:#fff;
  padding:2em 1em;
}

td[style="color:#CC0000"]{
  font-size:1.125em;
}
}
